import { Nav } from "../components/Nav";
import { Banner } from "../components/Banner";
import { Info } from "../components/Info";
import { Footer } from "../components/Footer";

export function Home() {
  return (
    <>
      <Nav />
      <Banner />
      <Info />
      <Footer />
    </>
  );
}
